                "description": "En la Inglaterra de 1820 la única carrera para la mujer es casarse. Pero Kate Worthington conoce su corazón y sabe bien que nunca lo hará. Su plan es viajar a la India, aunque solo sea para encontrar la paz que le pide su espíritu inquieto y para escapar de una familia a la que aborrece. Sin embargo, su entrometida madre tiene otros planes para ella, así que le plantea un trato: podrá ir a la India, sí, pero solo tras haber conseguido —y rechazado— tres propuestas de matrimonio. Decidida a cumplir su parte del trato, Kate parte hacia la mansion de Blackmoore para pedir ayuda a su amigo de la infancia, Henry Delafield. ¿Será capaz de rechazar una propuesta que, en realidad, es lo único que puede dar alas a su corazón? LOS LECTORES OPINAN: «Evocadora y cautivadora. Sus preciosas imágenes, la tensión palpable y su argumento fascinante embelesarán sin reservas al lector.» Publishers Weekly «Creo que las fans de Jane Austen estarán encantadas con el debut de esta autora, pues su obra tiene el aroma de sus libros, aunque sin duda posee su estilo propio y personal.» El rincón romántico Premios y logros de Julianne Donaldson: Autora ganadora del premio Whitney 2012 a la mejor novela de autor novel y a la mejor novela romántica por Edenbrooke. En 2013 su siguiente novela, Blackmoore, ha ganado el mismo premio a la mejor novela del año y a la mejor novela romántica histórica. Ganadora del PREMIO DAMA 2014 a la mejor novela romántica histórica otorgado por Club Romántica: http://www.clubromantica.com/DDSS Edenbrooke, ganadora del PREMIO RNR 2014 al Mejor romance histórico internacional de 2014 otorgado por la comunidad de lectores de El rincón de la novela romántica. Edenbrooke, Finalista 2012 como mejor libro del año, Foreword Magazine; Mención de honor en el Great Southwest Book Festival 2012, finalista a mejor romance del año 2012 en Goodreads. PREMIO RNR a la mejor autora revelación internacional de 2014. Gran éxito en español de sus novelas: reedición de sus 2 libros. Círculo de Lectores ha publicado en España sus dos libros con tiradas de 10.000 ejemplares.",
