                "publishedDate": "2016-04-12",
                "description": "La vida y la obra de Rubén Darío estuvieron marcadas desde su nacimiento por un extraño designio de confusión y equívocos. Su nombre no era su verdadero nombre, sus padres no eran sus verdaderos padres, el país en donde alcanzó la verdadera fama literaria no era el país que le vio nacer, los primeros juicios que sobre él emitieron personajes ilustres y autorizados se harán populares más tarde de un modo inexacto y ambiguo. Pocos podrían sostener hoy en día que no fue –que no es– el “Poeta de América”. De cualquier modo –y cualesquiera que sean sus contradicciones y ambigüedades–, hay un camino en la trayectoria de Darío que nunca podrá ser reversible, el camino de su renovación artística. Más allá de la significación anecdótica de su peripecia vital, más allá del lugar que haya ocupado en el agitado clamor social de la realidad hispanoamericana («¿Tantos millones de hombres hablaremos inglés?»), más allá de lo que los críticos hayan afirmado durante años, el «amor al amor y el amor a la poesía» que derrochó durante toda su vida hicieron de él, no sólo el poeta más universal de América, sino, lo que es mucho más trascendente, el poeta sin cuya obra jamás podría haberse producido la transformación que experimenta durante el siglo XX la poesía escrita en lengua castellana.",
