                "description": "El Romancero gitano (1928) es una de las obras más conocidas y populares de Federico García Lorca. El libro está compuesto por dieciocho romances, con temas como la noche, la muerte, el cielo, la Luna. Con el trasfondo de la cultura gitana, el poemario trasciende sus tópicos para fraguar una poesía sugerente y sugestiva, que ha cautivado ya a varias generaciones de lectores. En este libro brilla el estilo lírico de Federico García Lorca, afincado en lo popular pero proyectado a lo universal, en la metáfora surrealista y natural, que es continuidad de las búsquedas estéticas de la poesía tradicional española, improvisada y cantada. Lorca pretende fundir el lenguaje narrativo con el lírico, sin que ninguno de ellos pierda su calidad y belleza. Recoge así la usanza del romancero: historias que comienzan en in media res y tienen un final inacabado, descripciones líricas, narrador épico y diálogos en estilo directo entre los personajes. El gitano, perseguido por las autoridades, al margen de la ley, es el protagonista del libro, donde el poeta consigue una síntesis entre el pensamiento popular y la tradición más castiza del romancero español.",
