                "publisher": "LITERATURA RANDOM HOUSE",
                "publishedDate": "2017-10-19",
                "description": "Morí por la belleza, de la colección «Poesía portátil», es una selección de poemas de Emily Dickinson que nos permite adentrarnos en los anhelos que la autora encerró en sus versos. Textos desprovistos de adornos y reglas que hablan de la mujer, de la enfermedad, de la muerte y de lo que nos espera después. Emily Dickinson es sin duda una de las eruditas más enigmáticas de la historia de la literatura, una mujer que murió a los cincuenta y cinco años siendo una desconocida y habiendo publicado solo siete poemas. En realidad había escrito casi dos mil y fue su hermana quién los encontró en un cajón, garabateados en pedazos de papel o cuidadosamente cosidos en cuadernillos. Dickinson vivió los últimos años de su vida sin salir de casa, recluida en una intimidad oscura que plasmó en cada verso. En ellos se respira la rabia contra una sociedad patriarcal que castigaba cualquier atisbo de independencia femenina, son poemas que se rebelan contra el mundo que la rodea y piden a gritos más libertad. Radical en fondo y forma, eliminó verbos, signos de puntuación y conectores; escribía sin adornos y sin reglas. La contundencia de su obra, su manera de entender el verso, la rima, la oración y la gramática, han marcado la poesía moderna. ------- «Es la esperanza lo que lleva plumas y se posa en el alma, cantando una tonada sin palabras que nunca tiene fin.» -------",
